precision highp float;
precision highp int;

#define UNIFORM_INSERTION_POINT

varying vec2 vPosition;


#define iTime time*.01
#define iResolution (vec2(width,height))

#define DTM 134.2

#define D 30.0
#define T 58.2
#define M 36.0

#define PI 3.14159265359

void main()
{
    vec2 uv = vPosition*2.-1.;
    uv.x *= iResolution.x/iResolution.y;

    float scale = (sin(iTime)*.5+.5);

    float d;

    vec3 col = vec3(0.0);

    for(int i = 0; i < 33; i++)
    {
        vec2 p = vec2(cos(float(i)/33.0*PI*2.0+iTime), sin(float(i)/33.0*PI*2.0+iTime));

        d = length(uv-p)*1.7;


    	if(d <= 3.0)
        {
            col += (vec3(
            sin(-iTime*PI*2.0+D+d*PI),
            sin(-iTime*PI*2.0+8.0*PI/3.0+M+d*PI),
            sin(-iTime*PI*2.0+8.0*PI/2.0+T+d*PI))*.5+.5)*sin(d*PI*DTM+iTime*DTM);
        }
    }

    d = length(uv)*2.2;

    col += vec3(
    	sin(-iTime*PI*3.0+D+d*PI),
        sin(-iTime*PI*2.0+4.0*PI/3.0+M+d*PI),
        sin(-iTime*PI*3.0+3.0*PI/2.0+T+d*PI));

		gl_FragColor = vec4(col, 1.0);
}

